import React from "react";
import Container from "@material-ui/core/Container";
import { Row, Col, Card, Button } from "react-bootstrap";
import "./About.css";
import MyPic from "../files/es.png";
import { Github, Linkedin } from "react-bootstrap-icons";

export default function About() {
  return (
    <div className="aboutComponent">
      <Container className="aboutContainer">
        <Row>
          <Col>
            <Card style={{ width: "auto" }} className="cardAbout">
              <Card.Img variant="top" src={MyPic} className="myImage" />
              <Card.Body>
                <Card.Title className="myName">Erlens Gadzans</Card.Title>
                <Card.Link
                  className="positionDescription"
                  href={
                    "https://strive.school/certificate/607731999566ba00173d7dbe"
                  }
                  target="_blank"
                >
                  Fullstack MERN Grad student
                </Card.Link>
                <Card.Text></Card.Text>
                <h3 className="myIcons">
                  <Github className="mr-2" />
                  <Linkedin className="mr-2" />
                  CV
                </h3>
              </Card.Body>
            </Card>
          </Col>
          <Col className="lg-9"></Col>
        </Row>
      </Container>
    </div>
  );
}
